import React from "react";

const Header = () => {
  return (
    <div>
      <div className="header bg-gray-800 h-16 mb-2">
        <h6 className="text-2xl float-left font-bold font-serif underline text-gray-200 mx-5 my-3 ">
          Student Management System
        </h6>
      </div>
    </div>
  );
};

export default Header;
